import './App.css';
import {Router, Routes, Route} from "react-router-dom";
import Home from "./pages/home";
import Canvas from './pages/canvas';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route exact path="/" element={<h1>page component</h1>}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
